import{Service}from"../service";export class Application extends Service{constructor(){super(...arguments),this.bar=0,this.top=0,this.left=0,this.insetFooter=0,this.right=0,this.bottom=0,this.footer=0,this.application={bar:{},top:{},left:{},insetFooter:{},right:{},bottom:{},footer:{}}}register(t,i,e){this.application[i]={[t]:e},this.update(i)}unregister(t,i){null!=this.application[i][t]&&(delete this.application[i][t],this.update(i))}update(t){this[t]=Object.values(this.application[t]).reduce((t,i)=>t+i,0)}};Application.property="application";